import React, { useState } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <header className="navbar">
      <div className="navbar__brand">
        <img src="path-to-logo.png" alt="BrickTech Logo" className="navbar__logo" />
        <span className="navbar__title">BrickTech Contracting Corp.</span>
      </div>
      <nav className={`navbar__menu ${menuOpen ? 'navbar__menu--open' : ''}`}>
        <a href="#home" className="navbar__link">Home</a>
        <a href="#about" className="navbar__link">About Us</a>
        <a href="#resources" className="navbar__link">Resource Catalogs</a>
        <div className="navbar__dropdown">
          <button className="navbar__dropbtn">Services</button>
          <div className="navbar__dropdown-content">
            <a href="#service1" className="navbar__link">Service 1</a>
            <a href="#service2" className="navbar__link">Service 2</a>
          </div>
        </div>
        <a href="#portfolio" className="navbar__link">Our Portfolio</a>
        <a href="#blog" className="navbar__link">Blog</a>
        <a href="#contact" className="navbar__link">Contact Us</a>
      </nav>
      <button className="navbar__toggle" onClick={toggleMenu}>
        <span className="navbar__toggle-icon"></span>
      </button>
    </header>
  );
};

export default Navbar;
